roller.do?list&isIframe&id=\"+tableName+\"\' />\";\r\n	$.dialog({\r\n		content: url,\r\n		drag :false,\r\n		lock : true,\r\n		title:\'菜单链接[\'+content+\']\',\r\n		opacity : 0.3,\r\n		width:400,\r\n		height:50,\r\n		cache:false,\r\n	    cancelVal: \'关闭\',\r\n	    cancel: function(){clip.destroy();},\r\n	    button : [{\r\n	    	id : \"coptyBtn\",\r\n	    	name : \"复制\",\r\n	    	callback : function () {\r\n	    	}\r\n	    }],\r\n	    init : function () {\r\n			clip = new ZeroClipboard.Client();\r\n			clip.setHandCursor( true );\r\n			\r\n			clip.addEventListener(\'mouseOver\', function(client){\r\n				clip.setText( document.getElementById(\"menuLink\").value );\r\n			});\r\n			clip.addEventListener(\'complete\', function(client, text){\r\n				alert(\"复制成功\");\r\n			});\r\n			var menuLink = $(\"#menuLink\").val();\r\n			$($(\"input[type=button]\")[0]).attr(\"id\",\"coptyBtn\");\r\n			clip.setText(menuLink);\r\n			clip.glue(\"coptyBtn\");\r\n	    }\r\n	});  \r\n}','list',NULL,'2c90ac564c9d1734014c9d22b16c0001'),('2c90ac564c9d1734014c9d3241ac0021','$(\"textarea\").height(60);\r\n\r\n$(function(){\r\n$(\"body\").append(\"<link href=\\\"plug-in/lhgDialog/skins/default.css\\\" rel=\\\"stylesheet\\\" id=\\\"lhgdialoglink\\\">\");\r\nvar $btn = $(\"<div class=\\\"ui_buttons\\\"  style=\\\"display:inline-block;padding:0px;\\\"><input style=\\\"position: relative;top: 0px;\\\" class=\\\"ui_state_highlight\\\" type=\\\"button\\\" value=\\\"sql解析\\\"  id=\\\"sqlAnalyze\\\" /></div>\");\r\n$(\"#cgr_sql\").after($btn);\r\n$btn.click(function(){\r\n $.ajax({\r\n    url:\"cgReportController.do?getFields\",\r\n    data:{sql:$(\"#cgr_sql\").val()},\r\n	type:\"Post\",\r\n    dataType:\"json\",\r\n    success:function(data){\r\n    if(data.status==\"success\"){\r\n	      $(\"#add_jform_graphreport_item_table\").empty();\r\n	      $.each(data.fields,function(index,e){\r\n			$(\"#addBtn_jform_graphreport_item\").click();\r\n			$(\"#add_jform_graphreport_item_table tr:last\").find(\":text\")\r\n				.eq(0).val(e)\r\n				.end().eq(1).val(e)\r\n				.end().eq(2).val(index);\r\n	      }); \r\n	      //resetTrNum(\"add_jform_graphreport_item_table\");\r\n    }else{\r\n		$.messager.alert(\'??\',data.datas);\r\n	}\r\n  }\r\n  });\r\n });\r\n});','form',NULL,'2c90ac564c9d1734014c9d22b16c0001'),('4028138151b3cf300151b42289dd000f','//自定义表单添加\r\nfunction autoFormAdd(){\r\n   \r\n  createdetailwindow(\'自定义表单添加\',\'autoFormController.do?viewContent&formName=employee_entry_form&id=&op=add\',1000,700);\r\n\r\n}\r\n\r\n//自定义表单编辑\r\nfunction autoFormUpdate(){\r\n    var rowData = $(\'#jform_employee_entryList\').datagrid(\'getSelected\');\r\n    if (!rowData) {\r\n	tip(\'请选择一条信息\');\r\n	return;\r\n   }	\r\n   var id = rowData.id;\r\n   createdetailwindow(\'自定义表单添加\',\'autoFormController.do?viewContent&formName=employee_entry_form&op=update&id=\'+id ,1000,700);\r\n\r\n}','list',NULL,'4028138151adbcc50151adfd13680002'),('4028b881535b12bd01535b4275ea0022','function cancel_check(){    \r\n     $(\'#jform_contactList\').datagrid(\'clearChecked\');\r\n}\r\n\r\nfunction groupmanage(){\r\n    addOneTab( \'通讯录分录维护\',\'cgAutoListController.do?list&id=jform_contact_group\')\r\n}\r\n\r\n$(document).ready(function () {\r\n      $(\'#add\').linkbutton({   \r\n           text:\'新增人员\'\r\n      })\r\n     $(\'#update\').linkbutton({   \r\n           text:\'修改人员\'\r\n      })\r\n});','list',NULL,'4028b881535b12bd01535b1ae3680001');
