INSERT INTO `jform_cgreport_head` VALUES ('402880e64e1ef94d014e1efefc2a0001','select * from weixin_account','weixin_account','测试多数据源功能','跨数据库报表演示','管理员','2016-03-15 11:34:38','admin',NULL,NULL,NULL,'jeewx-yunying','','','1'),('402880e64eb9a22c014eb9a4d5890001','select * from t_s_base_user','ddt_s_base_user','全表查询','用户全部查询报表','管理员','2017-03-01 22:38:53','admin',NULL,NULL,NULL,'','','','2'),('402880e74d76e784014d76f9e783001e','select username account , realname from t_s_base_user','user_msg','用户POPUP，弹出页面','POPUP用户列表','张清照','2017-10-10 23:57:09','zqz',NULL,NULL,NULL,'','account','realname','2'),('402881885eb4ef7f015ebb5c94b7006a','SELECT * FROM  wm_stt_in_goods t where stt_sta = \'已完成\' and t.goods_qua <> t.stt_qua','wm_stt_cy','','盘点差异','admin','2017-09-26 07:31:23','admin',NULL,NULL,NULL,'','','','1'),('402881885f0c77e5015f10fa58890080','SELECT \r\n    wv.create_date,\r\n   wv.order_id,\r\n    wv.ku_wei_bian_ma,\r\n    wv.bin_id,\r\n    wv.cus_code,\r\n    wv.zhong_wen_qch,\r\n    wv.shp_ming_cheng,\r\n    wv.goods_pro_data,\r\n    wv.base_goodscount,\r\n    wv.base_unit,\r\n    mb.ku_wei_lei_xing as leixing\r\nFROM\r\n    wv_stock_base wv,\r\n    md_bin mb\r\nwhere\r\n    wv.ku_wei_bian_ma = mb.ku_wei_bian_ma and\r\n    wv.kuctype = \'库存\'','wm_jck','','进出库报表','admin','2018-03-26 11:51:47','admin',NULL,NULL,NULL,'','','','1'),('402881885f193f67015f19c0ac0c0007','select im_sta, count(*) as count from wm_im_notice_h group by im_sta','wm_im_sta','','订单进度',NULL,NULL,NULL,'admin','2017-10-14 15:19:38','admin','','','','1'),('402881885f23b8b8015f254064d2002f',' select \r\n        `wg`.`create_date` AS `create_date`,\r\n        `wg`.`create_name` AS `create_name`,\r\n        `wg`.`create_by` AS `create_by`,\r\n         wg.im_notice_id,\r\n         wg.item_text,\r\n         wg.rec_deg,\r\n        `wg`.`bin_id` AS `ku_wei_bian_ma`,\r\n        `wg`.`tin_id` AS `bin_id`,\r\n        `wg`.`cus_code` AS `cus_code`,\r\n        `mc`.`zhong_wen_qch` AS `zhong_wen_qch`,\r\n        `mg`.`goods_id` AS `goods_code`,\r\n        `wg`.`goods_id` AS `goods_id`,\r\n        `wg`.`qm_ok_quat` AS `goods_qua`,\r\n        `mg`.`goods_name` AS `shp_ming_cheng`,\r\n        `wg`.`pro_data` AS `goods_pro_data`,\r\n        `mg`.`bzhi_qi` AS `bzhi_qi`,\r\n        `wg`.`goods_unit` AS `goods_unit`,\r\n        `wg`.`base_unit` AS `base_unit`,\r\n        `wg`.`base_goodscount` AS `base_goodscount`,\r\nmg.zhl_kg,\r\n(`wg`.`base_goodscount` * mg.zhl_kg) as sumzhl\r\n    from\r\n        ((`wm_in_qm_i` `wg`\r\n        join `md_cus` `mc`)\r\n        join `mv_goods` `mg`)\r\n    where\r\n        ((`wg`.`cus_code` = `mc`.`ke_hu_bian_ma`)\r\n            and (`wg`.`goods_id` = `mg`.`goods_code`)\r\n)  having base_goodscount > 0\r\n    ','wm_in_qm','','验收明细','admin','2017-10-26 09:55:13','admin',NULL,NULL,NULL,'','','','1'),('402881885f23b8b8015f254836c60042','select \r\n        `wg`.`create_date` AS `create_date`,\r\n        `wg`.`create_name` AS `create_name`,\r\n        `wg`.`create_by` AS `create_by`,\r\n         wg.order_id,\r\n        `wg`.`ku_wei_bian_ma` AS `ku_wei_bian_ma`,\r\n        `wg`.`bin_id` AS `bin_id`,\r\n        `wg`.`cus_code` AS `cus_code`,\r\n        `mc`.`zhong_wen_qch` AS `zhong_wen_qch`,\r\n        `mg`.`goods_id` AS `goods_code`,\r\n        `mg`.`goods_name` AS `shp_ming_cheng`,\r\n        `wg`.`goods_pro_data` AS `goods_pro_data`,\r\n        `mg`.`bzhi_qi` AS `bzhi_qi`,\r\n        `wg`.`base_unit` AS `base_unit`,\r\n        `wg`.`base_goodscount` AS `base_goodscount`,\r\n  mg.zhl_kg\r\n    from\r\n        ((`wm_to_up_goods` `wg`\r\n        join `md_cus` `mc`)\r\n        join `mv_goods` `mg`)\r\n    where\r\n        ((`wg`.`cus_code` = `mc`.`ke_hu_bian_ma`)\r\n            and (`wg`.`goods_id` = `mg`.`goods_code`))\r\norder by `wg`.`create_date` desc\r\n   ','wm_to_up_d','','上架明细','admin','2017-11-20 21:44:01','admin',NULL,NULL,NULL,'','','','1'),('402881885f23b8b8015f254d22d80052','select \r\n        `wg`.`create_date` AS `create_date`,\r\n        `wg`.`create_name` AS `create_name`,\r\n\r\n        wg.order_id,\r\n        `wg`.`ku_wei_bian_ma` AS `ku_wei_bian_ma`,\r\n        `wg`.`bin_id_from` AS `bin_id`,\r\n        wg.bin_id_to,\r\n        `wg`.`cus_code` AS `cus_code`,\r\n        `mc`.`zhong_wen_qch` AS `zhong_wen_qch`,\r\n        `mg`.`goods_id` AS `goods_code`,\r\n\r\n \r\n        `mg`.`goods_name` AS `shp_ming_cheng`,\r\n        `wg`.`goods_pro_data` AS `goods_pro_data`,\r\n        `mg`.`bzhi_qi` AS `bzhi_qi`,\r\n\r\n        `wg`.`base_unit` AS `base_unit`,\r\n        `wg`.`base_goodscount` AS `base_goodscount`,\r\nmg.zhl_kg\r\n    from\r\n        ((`wm_to_down_goods` `wg`\r\n        join `md_cus` `mc`)\r\n        join `mv_goods` `mg`)\r\n    where\r\n        ((`wg`.`cus_code` = `mc`.`ke_hu_bian_ma`)\r\n            and (`wg`.`goods_id` = `mg`.`goods_code`))\r\norder by `wg`.`create_date` desc','wm_to_down','','下架明细','初始','2018-09-25 14:02:32','admin',NULL,NULL,NULL,'','','','1'),('402881885f2de2c8015f2dedf564031c','select \r\n    wc.cus_code,\r\n    wc.cus_name,\r\n    wc.cost_code,\r\n    wc.cost_name,\r\n    wc.cost_data,\r\n     FORMAT(sum(wc.day_cost_yj),2) as yuanj,\r\n     FORMAT(sum(wc.day_cost_bhs),2) as bhsj,\r\n     FORMAT(sum(wc.day_cost_se),2) as shuie,\r\n     FORMAT(sum(wc.day_cost_hsj),2) as hansj\r\nfrom\r\n    wm_day_cost wc\r\ngroup by wc.cus_code , wc.cus_name , wc.cost_code , wc.cost_name , wc.cost_data','wm_month_cost','','费用合计','admin','2017-10-20 11:58:06','admin',NULL,NULL,NULL,'','','','1'),('402881885f2de2c8015f2df70d8b032c','select \'卸货费\' as feiyong,wi.create_name, wi.create_date, wi.im_notice_id,    wi.goods_id, mg.shp_ming_cheng,   sum(wi.qm_ok_quat) as qmcount, format((sum(wi.qm_ok_quat) * mg.zhl_kg  ),2) as grcount,   format((sum(wi.qm_ok_quat) * mg.zhl_kg *11/1000 ),2) as grcountfy \r\n					,\'11\'as danjia from    wm_in_qm_i wi,    mv_goods mg where  wi.goods_id = mg.goods_id and wi.qm_ok_quat > 0 \r\n					 group by wi.create_name,wi.im_notice_id ,wi.cus_code,  wi.goods_id ','wm_inqm_feiy','','卸货费','admin','2017-10-22 21:29:13','admin',NULL,NULL,NULL,'','','','1'),('402881885f2de2c8015f2dfbc1610339','select \r\n    \'装车费\' as feiyong,\r\n    wi.create_name,\r\n    wi.create_date,\r\n    wi.order_id,\r\n    wi.goods_id,\r\n    mg.shp_ming_cheng,\r\n    sum(wi.base_goodscount) as qmcount,\r\n    format((sum(wi.base_goodscount) * mg.zhl_kg),\r\n        2) as grcount,\r\n    format((sum(wi.base_goodscount) * mg.zhl_kg * 11 / 1000),\r\n        2) as grcountfy,\r\n  \'11\'  as  danjia\r\nfrom\r\n    wm_to_down_goods wi,\r\n    mv_goods mg\r\nwhere\r\n    wi.goods_id = mg.goods_id\r\n        and wi.base_goodscount > 0\r\nand wi.order_id <> \'ZY\'\r\ngroup by wi.create_name , wi.order_id , wi.cus_code , wi.goods_id','wm_to_downfy','','装车费','admin','2017-10-22 21:31:50','admin',NULL,NULL,NULL,'','','','1'),('402881885f2de2c8015f2e3f81d70366','select \r\n    wc.cus_code,\r\n    wc.cus_name,\r\n    wc.cost_code,\r\n    wc.cost_name,\r\n     FORMAT(sum(wc.day_cost_yj),2) as yuanj,\r\n     FORMAT(sum(wc.day_cost_bhs),2) as bhsj,\r\n     FORMAT(sum(wc.day_cost_se),2) as shuie,\r\n     FORMAT(sum(wc.day_cost_hsj),2) as hansj\r\nfrom\r\n    wm_day_cost wc\r\ngroup by wc.cus_code , wc.cus_name , wc.cost_code , wc.cost_name ','wm_sum_hejii','','合计','admin','2017-10-20 12:01:20','admin',NULL,NULL,NULL,'','','','1'),('402881885f3f9203015f450115f502c6','select ws.*, count(*) as count from wv_stock_base ws where ws.kuctype = \'库存\' and ws.create_date >=${begin_date} and ws.create_date <=${end_date}  group by ws.cus_code ,ws.goods_id ','jckcs','','进出库次数','admin','2017-10-23 00:54:17','admin',NULL,NULL,NULL,'','','','1'),('402881885f49c21c015f4e9994ee085e','SELECT \r\n    wh.his_date,\r\n    wh.cus_code,\r\n    mc.zhong_wen_qch,\r\n    wh.ku_wei_bian_ma,\r\n    wh.bin_id,\r\n    wh.goods_id,\r\n    mg.shp_ming_cheng,\r\n    wh.count,\r\n    wh.base_unit,\r\n(mg.zhl_kg / mg.chl_shl) as zhl_kg\r\nFROM\r\n    wm_his_stock as wh,\r\n    md_cus  as mc,\r\n    md_goods as mg\r\nwhere  wh.cus_code = mc.ke_hu_bian_ma   and wh.goods_id = mg.shp_bian_ma','wm_his_stock','','计费历史库存','admin','2018-01-15 21:03:35','admin',NULL,NULL,NULL,'','','','1'),('402881885f49c21c015f4f42f7c9263b','select goods_code as goods_code,goods_name as goods_name from mv_goods','mv_goodssel','','商品',NULL,NULL,NULL,'admin','2017-10-25 00:41:50','admin','','goods_code','goods_name','1'),('402881885f49c21c015f4f43d17f263f','select goods_code as goods_code,goods_name as goods_name,(select sum(base_goodscount) from wv_stock where goods_code = mv_goods.goods_code  ) as scount from mv_goods having scount > 0','mv_goodssels','','商品',NULL,NULL,NULL,'admin','2017-10-25 00:42:46','admin','','goods_code','goods_name','1'),('402881885f5463b2015f58cba4be20e0','select \r\n        `wg`.`create_date` AS `create_date`,\r\n        `wg`.`create_name` AS `create_name`,\r\n        wg.update_name,\r\n        `wg`.`ku_wei_bian_ma` AS `ku_wei_bian_ma`,\r\n        `wg`.`bin_id_from` AS `bin_id`,\r\n        wg.bin_id_to,\r\n        `wg`.`cus_code` AS `cus_code`,\r\n        `mc`.`zhong_wen_qch` AS `zhong_wen_qch`,\r\n        `mg`.`goods_id` AS `goods_code`,\r\n        `mg`.`goods_name` AS `shp_ming_cheng`,\r\n        `wg`.`goods_pro_data` AS `goods_pro_data`,\r\n        `mg`.`bzhi_qi` AS `bzhi_qi`,\r\n        `wg`.`base_unit` AS `base_unit`,\r\n        `wg`.`goods_qua`,\r\n `wg`.`goods_quaok`,\r\nmg.zhl_kg\r\n    from\r\n        ((`wm_to_down_goods` `wg`\r\n        join `md_cus` `mc`)\r\n        join `mv_goods` `mg`)\r\n    where\r\n        ((`wg`.`cus_code` = `mc`.`ke_hu_bian_ma`)\r\n            and (`wg`.`goods_id` = `mg`.`goods_code`)\r\n           and wg.goods_qua <> wg.goods_quaok)\r\n order by wg.create_date desc','wm_to_down_chayi','','下架与复核差异',NULL,NULL,NULL,'admin','2017-10-26 21:07:42','admin','','','','1'),('402881885f58cd6e015f5944b75f015f','SELECT \r\n    wh.his_date,\r\n    wh.cus_code,\r\n    mc.zhong_wen_qch,\r\n    wh.ku_wei_bian_ma,\r\n    wh.bin_id,\r\n    wh.goods_id,\r\n    mg.shp_ming_cheng,\r\n    wh.count,\r\n    wh.base_unit,\r\n(mg.zhl_kg / mg.chl_shl) as zhl_kg,\r\nmg.chl_shl\r\nFROM\r\n    wm_his_stock_ku as wh,\r\n    md_cus  as mc,\r\n    md_goods as mg\r\nwhere  wh.cus_code = mc.ke_hu_bian_ma   and wh.goods_id = mg.shp_bian_ma','wm_his_stock_ku','','历史库存查询','admin','2018-01-15 21:02:52','admin',NULL,NULL,NULL,'','','','1'),('402881885f72f685015f781ab9020837','select  wv.* from wv_stock wv where goods_id in(\r\nselect distinct\r\n    (goods_id)\r\nfrom\r\n    wv_stock ws\r\nwhere\r\n    goods_id not in (select \r\n            goods_id\r\n        from\r\n            wv_stock\r\n        where\r\n            shang_jia_ci_xu = \'999999\')) \r\ngroup by goods_id\r\norder by goods_id,goods_pro_data,goods_qua desc\r\n\r\n','WMLHRW','','理货任务','admin','2017-11-01 23:09:11','admin',NULL,NULL,NULL,'','','','1'),('40288188606ec04d016071f7e94c00eb','select * from wm_wendu   order by wendu_cjsj  desc\r\n ','wm_wendubb','','温度报表','admin','2017-12-20 11:32:03','admin',NULL,NULL,NULL,'','','','1'),('4028818860de79e101610cafb34e1c0e','SELECT * FROM zzjee.wm_im_notice_h where im_sta = \'计划中\' and  im_data <= now()','IMJHYSYJ','','进货延时预警',NULL,NULL,NULL,'admin','2018-01-19 12:31:37','admin','','','','1'),('4028818861332e76016142b5f5ae0d07','select * from mv_goods','mv_goods','','商品明细','admin','2018-01-30 00:20:51','admin',NULL,NULL,NULL,'','','','1'),('402881b265c8623e0165c872ad040164','select * from rp_wm_down_and_qm  where ifnull(sumqua,0) <> ifnull(base_goodscount,0)\r\n','rp_om_down','','出货异常','初始','2018-09-12 08:22:17','admin',NULL,NULL,NULL,'','','','1'),('402881b265dca7fc0165e29c405c0399','select * from rp_wm_down_and_qm   \r\n','rp_om_detail','','出库明细',NULL,NULL,NULL,'初始','2018-09-16 21:40:16','admin','','','','1'),('402881b265e3224e0165e32d85c5000e','SELECT * FROM wv_no_use_bin order by  binid','wv_no_use_bin','','空储位','初始','2018-09-17 00:19:25','admin',NULL,NULL,NULL,'','','','1'),('4028b8815e11c8f1015e1202d05b0014','select \r\n    h.notice_id,\r\n    h.cus_code,\r\n    h.im_cus_code,\r\n    mc.zhong_wen_qch,\r\n    h.im_sta,\r\n    i.goods_code,\r\n    mg.shp_ming_cheng as shp_ming_cheng,\r\n    i.goods_count,\r\n    i.goods_qm_count,\r\n    i.goods_unit as shl_dan_wei,\r\n\r\n    cast(i.goods_fvol  AS DECIMAL(18,0)) as goods_fvol,\r\n    cast(i.goods_weight AS DECIMAL(18,0)) as goods_weight,\r\n    i.base_unit,\r\n    i.base_goodscount,\r\n DATE_FORMAT( i.goods_prd_data, \'%Y-%m-%d \')  as  goods_prd_data\r\n   \r\n\r\nfrom\r\n    wm_im_notice_h h,\r\n    wm_im_notice_i i,\r\n    md_cus mc,\r\n    mv_goods mg\r\nwhere\r\n    h.notice_id = i.im_notice_id\r\n        and h.cus_code = mc.ke_hu_bian_ma\r\n        and i.goods_code = mg.goods_code \r\norder by h.create_date desc','wm_in_detail','','预约通知明细','admin','2017-11-30 14:40:14','admin',NULL,NULL,NULL,'','','','1'),('4028b8815e11c8f1015e1218fb6d0028','select \r\n    \'托盘上\' as kucunsta,\r\n    i.bin_id,\r\n    i.tin_id,\r\n    i.cus_code,\r\n    mc.zhong_wen_qch,\r\n    i.goods_id,\r\n    mg.goods_name as shp_ming_cheng,\r\n	mg.shl_dan_wei,\r\n    i.qm_ok_quat,\r\n    i.pro_data,\r\n    i.create_date,\r\n    mg.bzhi_qi\r\nfrom\r\n    md_cus mc,\r\n    mv_goods mg,\r\n    wm_in_qm_i i\r\nwhere\r\n    i.cus_code = mc.ke_hu_bian_ma\r\n        and i.goods_id = mg.goods_code\r\n        and i.bin_sta = \'N\'','wm_tuopan','','收货未上架库存','admin','2017-09-11 21:04:12','admin',NULL,NULL,NULL,'','','','1'),('4028b8815e124416015e12547ccf0001','SELECT * FROM wv_stock where    base_goodscount <> 0','wm_stock','','储位库存','admin','2018-01-30 21:57:20','admin',NULL,NULL,NULL,'','','','1'),('4028b8815e16ec74015e16f89c650007','select \r\n    h.om_notice_id,\r\n    h.cus_code,\r\n    i.cus_name as zhong_wen_qch,\r\n    h.om_sta,\r\n    i.goods_id,\r\n    i.goods_name as shp_ming_cheng,\r\n    i.base_goodscount as goods_qua,\r\n   (select sum( CONVERT(om.base_goodscount , SIGNED))  from wm_om_qm_i om where om.iom_notice_item = i.id) as goods_quaok,\r\n    i.base_unit\r\nfrom\r\n    wm_om_notice_h h,\r\n    wm_om_notice_i i\r\nwhere\r\n    h.om_notice_id = i.om_notice_id\r\n     and h.om_sta <> \'已完成\' and  h.om_sta <> \'已删除\'\r\nhaving goods_qua >  goods_quaok\r\norder by h.create_date desc','wm_om_notice','','异常出库通知明细','初始','2018-10-14 15:16:54','admin',NULL,NULL,NULL,'','','','1'),('4028b8815e486236015e4884a1050021','SELECT * FROM  mv_stock_yj where base_goodscount > 0','WMDQR','','效期预警','admin','2017-09-17 22:05:07','admin',NULL,NULL,NULL,'','','','1'),('4028b8815e5c7a5d015e5c7cffa50001','SELECT * FROM wv_avabin  order by  binid','wm_kybin','','可用储位','admin','2017-09-26 05:23:49','admin',NULL,NULL,NULL,'','','','1'),('8a7ba3345e481b91015e484587d4000f','select \r\n    \'在途\' as kuctype,\r\n    wd.order_id,\r\n	wd.create_date,\r\n    wd.cus_code,\r\n    mc.zhong_wen_qch,\r\n    wd.goods_id,\r\n    mg.goods_name as shp_ming_cheng,\r\n    mg.shl_dan_wei,\r\n    wd.goods_pro_data,\r\n    wd.ku_wei_bian_ma,\r\n    wd.goods_quaok\r\nfrom\r\n    wm_to_down_goods wd,\r\n    mv_goods mg,\r\n    md_cus mc\r\n \r\nwhere\r\n    wd.cus_code = mc.ke_hu_bian_ma\r\n        and wd.goods_id = mg.goods_code\r\nand wd.order_id not in(select wm_notice_id from wm_notice_conf)\r\n','wm_om_stock','','在途库存','admin','2017-09-12 07:44:45','admin',NULL,NULL,NULL,'','','','1');
