 \'Microsoft YaHei\', Arial, Helvetica, sans-serif; line-height: 1.33em; margin-right: 0px; margin-left: 0px; font-weight: bold; padding: 0px; font-size: 24px; -webkit-font-smoothing: antialiased; cursor: text; position: relative; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(204, 204, 204); color: rgb(0, 0, 0); background-color: rgb(250, 250, 250);\"><a class=\"anchor\" id=\"技术交流\" href=\"http://git.oschina.net/jeecg/jeecg#技术交流\" style=\"box-sizing: inherit; color: rgb(65, 131, 196); word-wrap: break-word; display: block; padding-left: 30px; margin-left: -20px; position: absolute; top: 0px; left: 0px; bottom: 0px;\"></a>技术交流</h2><ul class=\"task-list\" style=\"box-sizing: inherit; font-size: 14px; line-height: 24px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, \'Helvetica Neue\', \'Microsoft YaHei\', Arial, Helvetica, sans-serif; background-color: rgb(250, 250, 250);\"><li style=\"box-sizing: inherit; list-style: initial; margin: 0px;\">作者：<a href=\"http://blog.csdn.net/zhangdaiscott\" style=\"box-sizing: inherit; color: rgb(65, 131, 196); word-wrap: break-word; margin-top: 0px; margin-bottom: 0px;\">张代浩</a></li><li style=\"box-sizing: inherit; list-style: initial; margin: 0px;\">QQ交流群： 176031980、106838471（满）、106259349（满）</li></ul>\n\n                    ','01','管理员','8a8ab0b246dc81120146dc8181950052'),('4028ef8153a650060153a653262c0010','管理员','admin','2016-03-24 09:53:00','123123',NULL,'<p>123123123123</p>','02','张代浩','8a8ab0b246dc81120146dc81819d0053'),('4028ef8153a650060153a6533a640013','管理员','admin','2016-03-24 09:53:05','123123',NULL,'<p>123123123123</p>','02','张代浩','8a8ab0b246dc81120146dc81819d0053'),('4028ef8153a650060153a6559ff80020','张代浩','scott','2016-03-24 09:55:42','222',NULL,'<p>222</p>','02','张代浩','8a8ab0b246dc81120146dc81819d0053'),('4028ef8153bad3530153badd38820001','管理员','admin','2016-03-28 09:36:13','12',NULL,'<p>12<br/></p>','02','张三,管理员','4028ef81538330cd01538333b7bc0001,8a8ab0b246dc81120146dc8181950052'),('4028ef8153bad3530153badd64510004','管理员','admin','2016-03-28 09:36:24','12',NULL,'<p>1212</p>','02','张三','4028ef81538330cd01538333b7bc0001'),('4028ef8153c5a4860153c5cb3997000d','管理员','admin','2016-03-30 12:32:23','1231',NULL,'<p>23</p>','02','张三','4028ef81538330cd01538333b7bc0001'),('4028ef8153c5a4860153c5cb5957000f','管理员','admin','2016-03-30 12:32:31','123',NULL,'<p>123</p>','02','demo','402880e74d75c4dd014d75d44af30005'),('4028ef8153c5a4860153c5cb63570011','管理员','admin','2016-03-30 12:32:34','123',NULL,'<p>123</p>','02','demo','402880e74d75c4dd014d75d44af30005'),('4028ef8153fe51210153fe5df3bd0001','管理员','admin','2016-04-10 12:11:23','112',NULL,'<h1 style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; color: rgb(51, 51, 51); white-space: normal; box-sizing: inherit; font-size: 28px; font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; line-height: 1.33em; min-height: 1rem; -webkit-font-smoothing: antialiased; cursor: text; position: relative; margin-top: 0px !important; background-color: rgb(255, 255, 255);\">Jeecg-P3 1.0 版本发布，插件开发框架</h1><p style=\"white-space: normal; box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);\">特点：业务组件以JAR方式提供，插件模式、松耦合、可插拔、支持独立部署，也可以无缝集成Jeecg平台中。</p><p style=\"white-space: normal; box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; word-break: break-word; line-height: 25px; font-size: 15px; font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; color: rgba(0, 0, 0, 0.8); text-align: justify; background-color: rgb(255, 255, 255);\">【架构说明】</p><pre style=\"white-space: pre-wrap; word-wrap: break-word; box-sizing: inherit; overflow: auto; font-family: Menlo, &#39;Liberation Mono&#39;, Consolas, &#39;DejaVu Sans Mono&#39;, &#39;Ubuntu Mono&#39;, &#39;Courier New&#39;, &#39;andale mono&#39;, &#39;lucida console&#39;, monospace; margin-top: 0px; margin-bottom: 15px; border: none; font-size: 13px; line-height: 19px; padding: 6px 10px; border-radius: 3px; color: rgb(51, 51, 51); background-color: rgb(244, 244, 244);\">1.Jeecg-P3&nbsp;采用SpringMvc&nbsp;+&nbsp;Minidao&nbsp;+&nbsp;Velocity&nbsp;+&nbsp;Maven(构建)&nbsp;框架技术\r\n2.插件引入方式\r\n&nbsp;&nbsp;&nbsp;&nbsp;pom.xml文件中，引入新开发的插件\r\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;P3&nbsp;jar&nbsp;--&gt;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;dependency&gt;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;groupId&gt;org.p3framework&lt;/groupId&gt;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;artifactId&gt;jeecg-p3-biz-demo&lt;/artifactId&gt;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;version&gt;1.0.0&lt;/version&gt;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;/dependency&gt;\r\n3.项目启动访问方式：\r\n&nbsp;&nbsp;采用maven方式，启动Web项目\r\n&nbsp;&nbsp;http://localhost/jeecg-p3-web/{页面访问地址}\r\n4.页面层面不能采用jsp，需要采用模板语言Velocity\r\n5.插件式开发,每个业务组件以jar包方式提供\r\n6.数据库配置文件：\r\n&nbsp;&nbsp;jeecg-p3-web/src/main/resources/dbconfig.properties</pre><p style=\"white-space: normal; box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);\">【项目说明】</p><pre style=\"white-space: pre-wrap; word-wrap: break-word; box-sizing: inherit; overflow: auto; font-family: Menlo, &#39;Liberation Mono&#39;, Consolas, &#39;DejaVu Sans Mono&#39;, &#39;Ubuntu Mono&#39;, &#39;Courier New&#39;, &#39;andale mono&#39;, &#39;lucida console&#39;, monospace; margin-top: 0px; margin-bottom: 15px; border: none; font-size: 13px; line-height: 19px; padding: 6px 10px; border-radius: 3px; color: rgb(51, 51, 51); background-color: rgb(244, 244, 244);\">jeecg-p3-web&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;|&nbsp;启动主项目\r\njeecg-p3-biz-demo&nbsp;|&nbsp;插件项目Demo</pre><p style=\"white-space: normal; box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);\">【开发入门】</p><pre style=\"white-space: pre-wrap; word-wrap: break-word; box-sizing: inherit; overflow: auto; font-family: Menlo, &#39;Liberation Mono&#39;, Consolas, &#39;DejaVu Sans Mono&#39;, &#39;Ubuntu Mono&#39;, &#39;Courier New&#39;, &#39;andale mono&#39;, &#39;lucida console&#39;, monospace; margin-top: 0px; margin-bottom: 15px; border: none; font-size: 13px; line-height: 19px; padding: 6px 10px; border-radius: 3px; color: rgb(51, 51, 51); background-color: rgb(244, 244, 244);\">☆准备工作：\r\n&nbsp;&nbsp;&nbsp;&nbsp;1.标准开发工具：eclipse&nbsp;+&nbsp;jdk7&nbsp;+&nbsp;tomcat7&nbsp;+&nbsp;mysql\r\n&nbsp;&nbsp;&nbsp;&nbsp;2.项目为maven工程，采用maven方式导入eclipse等IDE开发工具&nbsp;\r\n\r\n☆快捷启动：\r\n&nbsp;&nbsp;&nbsp;&nbsp;第一步：创建Mysql数据库jeecg-p3，采用UTF-8编码，执行下面数据库脚本\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;jeecg-p3-web/doc/sql/jeecg-p3-mysql.sql\r\n&nbsp;&nbsp;&nbsp;&nbsp;第二步：双击运行jeecg-p3-web\\bin\\run-tomcat7.bat或bin\\run-tomcat.bat，\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;启动Web服务器（第一次运行，需要下载依赖jar包，请耐心等待）。\r\n&nbsp;&nbsp;&nbsp;&nbsp;第三步：测试访问地址\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.&nbsp;http://localhost/jeecg-p3-web/p3/wxActInvite.do?list\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.&nbsp;http://localhost/jeecg-p3-web/p3/auth.do?list&nbsp;&nbsp;&nbsp;&nbsp;\r\n\r\n☆Eclipse运行步骤：\r\n&nbsp;&nbsp;&nbsp;&nbsp;第一步：创建Mysql数据库jeecg-p3，采用UTF-8编码，执行下面数据库脚本\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;jeecg-p3-web/doc/sql/jeecg-p3-mysql.sql\r\n&nbsp;&nbsp;&nbsp;&nbsp;第二步：采用maven方式启动项目&nbsp;(jeecg-p3-web)\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;项目右建-&gt;debug&nbsp;as-&gt;debug&nbsp;configurations-&gt;选中jeecg-p3-web项目-&gt;输入命令：tomcat:run\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;注意：[1].update&nbsp;snapshots需要选中，官方会不断更新底层包\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;[2].插件项目不能单独启动，需以maven方式引入jeecg-p3-web项目中，启动web主项目\r\n&nbsp;&nbsp;&nbsp;&nbsp;第四步：测试访问地址\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.&nbsp;http://localhost/jeecg-p3-web/p3/wxActInvite.do?list\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.&nbsp;http://localhost/jeecg-p3-web/p3/auth.do?list</pre><p style=\"white-space: normal; box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);\">【代码生成器】</p><pre style=\"white-space: pre-wrap; word-wrap: break-word; box-sizing: inherit; overflow: auto; font-family: Menlo, &#39;Liberation Mono&#39;, Consolas, &#39;DejaVu Sans Mono&#39;, &#39;Ubuntu Mono&#39;, &#39;Courier New&#39;, &#39;andale mono&#39;, &#39;lucida console&#39;, monospace; margin-top: 0px; margin-bottom: 15px; border: none; font-size: 13px; line-height: 19px; padding: 6px 10px; border-radius: 3px; color: rgb(51, 51, 51); background-color: rgb(244, 244, 244);\">1.工具类：jeecg-p3-web/src/main/java/util/P3CodeGenerateUtil.java\r\n2.配置文件：jeecg-p3-web/src/main/resources/p3-cg-config.properties</pre><h1 style=\"margin: 20px 0px 10px; padding: 0px; color: rgb(51, 51, 51); white-space: normal; box-sizing: inherit; font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; line-height: 1.33em; min-height: 1rem; -webkit-font-smoothing: antialiased; cursor: text; position: relative; background-color: rgb(255, 255, 255);\"><a style=\"color: rgb(51, 102, 153);\" name=\"t1\"></a><a target=\"_blank\" class=\"anchor\" id=\"技术交流\" href=\"http://git.oschina.net/jeecg/jeecg-p3#技术交流\" style=\"color: rgb(65, 131, 196); text-decoration: none; font-size: 28px; box-sizing: inherit; cursor: pointer; word-wrap: break-word; display: block; padding-left: 30px; margin-left: -20px; position: absolute; top: 0px; left: 0px; bottom: 0px; background-image: initial; background-attachment: initial; background-color: transparent; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a><span style=\"font-size: 18px;\">技术交流</span></h1><ul class=\"task-list list-paddingleft-2\" style=\"font-size: 14px; white-space: normal; box-sizing: inherit; line-height: 24px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);\"><li><p>论 &nbsp;坛：<a target=\"_blank\" href=\"http://www.jeecg.org/\" style=\"color: rgb(65, 131, 196); text-decoration: none; box-sizing: inherit; word-wrap: break-word; margin-top: 0px; margin-bottom: 0px; cursor: pointer !important; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">www.jeecg.org</a></p></li><li><p>源码下载：<a target=\"_blank\" href=\"http://git.oschina.net/jeecg/jeecg-p3\" style=\"color: rgb(34, 0, 0); text-decoration: none;\">http://git.oschina.net/jeecg/jeecg-p3</a></p></li><li><p>QQ交流群: 106838471</p></li></