CREATE DEFINER=`root`@`localhost` PROCEDURE `update_wm_his_stock`(in wmdate varchar(45))
BEGIN

delete from wm_his_stock where his_date = wmdate;
delete from wm_his_stock_ku where his_date = wmdate;
delete  FROM zzjee.wm_day_cost where day_cost_yj = 0;
INSERT INTO wm_his_stock (
  `id` ,
  `his_date` ,
  `cus_code` ,
  `ku_wei_bian_ma` ,
  `bin_id` ,
  `goods_id` ,
  `count` ,
  `base_unit`
)
SELECT 
    concat(wmdate,
            mdp.cus_code,
            mdp.ku_wei_bian_ma,
            mdp.bin_id,
            mdp.goods_id) as id,
    wmdate as his_date,
    mdp.cus_code,
    mdp.ku_wei_bian_ma,
    mdp.bin_id,
    mdp.goods_id,
    sum(base_goodscount) as count,
    mdp.base_unit
 
FROM
    mv_down_and_up mdp
where
    (mdp.leixing = 'S'
        and to_days(mdp.create_date) <= to_days(wmdate))
        or (mdp.order_id <> 'ZY'
        and mdp.leixing = 'H'
        and to_days(mdp.create_date) < to_days(wmdate))
        or (mdp.order_id = 'ZY'
        and mdp.leixing = 'H'
        and to_days(mdp.create_date) <= to_days(wmdate))
group by mdp.cus_code , mdp.ku_wei_bian_ma , mdp.bin_id
having sum(base_goodscount) <> 0
order by cus_code , create_date;


INSERT INTO wm_his_stock_ku (
  `id` ,
  `his_date` ,
  `cus_code` ,
  `ku_wei_bian_ma` ,
  `bin_id` ,
